import { useDispatch, useSelector } from "react-redux"
const List = () => {
    const lists = useSelector((state) => state.listing) || []
    return (
        <div>
            {lists.map((item, index) => {
                <ul key={index}>
                    <li>{item}</li>
                    <button onClick={() => useDispatch(deleteList(index))}>Delete</button>
                </ul>
            })}
        </div>
    )
}

export default List;
